DROP TABLE IF EXISTS `tbl_asset_interface`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `tbl_asset_interface` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `if_name` varchar(60) NOT NULL,
  `description` varchar(150) DEFAULT NULL,
  `oper_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Interface up or down\ndefault down',
  `admin_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'Interface up or down\ndefault up',
  `mode_id` int(10) unsigned NOT NULL COMMENT 'Assecc, trunk or route interface',
  `asset_id` int(10) unsigned NOT NULL,
  `is_physical` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'physical or virtual',
  PRIMARY KEY (`id`),
  KEY `tbl_asset_if_fk_1_idx` (`asset_id`),
  KEY `tbl_asset_if_fk_2_idx` (`mode_id`),
  CONSTRAINT `tbl_asset_if_fk_1` FOREIGN KEY (`asset_id`) REFERENCES `tbl_asset_inventory` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tbl_asset_if_fk_2` FOREIGN KEY (`mode_id`) REFERENCES `tbl_interface_mode` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=16741 DEFAULT CHARSET=utf8;
